import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { PodData } from '../types';
import { getLatestPodData } from '../utils/helpers';
import PodCard from '../components/PodCard';
import ChatBot from '../components/ChatBot';

const Dashboard: React.FC = () => {
  const [pods, setPods] = useState<PodData[]>([]);
  const [loading, setLoading] = useState(true);
  const [chatOpen, setChatOpen] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchPods = async () => {
      try {
        const response = await fetch('/data/pods.json');
        const data = await response.json();
        const latestPods = getLatestPodData(data);
        setPods(latestPods);
      } catch (error) {
        console.error('Error fetching pods:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchPods();
  }, []);

  const handlePodClick = (podId: string) => {
    navigate(`/pod/${podId}`);
  };

  const redPodsCount = pods.filter(pod => {
    const o2harBreached = pod.o2har > 9.0;
    const unserviceabilityBreached = pod.unserviceability > 5.0;
    return o2harBreached || unserviceabilityBreached;
  }).length;

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-instamart-blue mx-auto mb-4"></div>
          <p className="text-gray-600">Loading pods...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-white shadow-sm border-b border-gray-200">
        <div className="max-w-4xl mx-auto px-4 py-4">
          <div className="flex items-center justify-between">
            <div>
              <h1 className="text-2xl font-bold text-gray-900">Instamart Ops Co-Pilot</h1>
              <p className="text-sm text-gray-600">Bangalore Operations Dashboard</p>
            </div>
            <div className="text-right">
              <div className="text-2xl font-bold text-instamart-red">{redPodsCount}</div>
              <div className="text-xs text-gray-600">Red Pods</div>
            </div>
          </div>
        </div>
      </div>

      {/* Stats Bar */}
      <div className="bg-white border-b border-gray-200">
        <div className="max-w-4xl mx-auto px-4 py-3">
          <div className="grid grid-cols-3 gap-4 text-center">
            <div>
              <div className="text-lg font-semibold text-gray-900">{pods.length}</div>
              <div className="text-xs text-gray-600">Total Pods</div>
            </div>
            <div>
              <div className="text-lg font-semibold text-instamart-green">
                {pods.length - redPodsCount}
              </div>
              <div className="text-xs text-gray-600">Green Pods</div>
            </div>
            <div>
              <div className="text-lg font-semibold text-instamart-red">{redPodsCount}</div>
              <div className="text-xs text-gray-600">Red Pods</div>
            </div>
          </div>
        </div>
      </div>

      {/* Pods Grid */}
      <div className="max-w-4xl mx-auto px-4 py-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          {pods.map((pod) => (
            <PodCard key={pod.pod_id} pod={pod} onClick={handlePodClick} />
          ))}
        </div>
      </div>

      {/* Floating Navigation */}
      <div className="fixed bottom-20 right-6 flex flex-col space-y-3">
        <button
          onClick={() => navigate('/alerts')}
          className="w-12 h-12 bg-instamart-gray text-white rounded-full shadow-lg hover:shadow-xl transition-shadow duration-200 flex items-center justify-center text-lg"
          title="Alerts"
        >
          ðŸ””
        </button>
      </div>

      {/* ChatBot */}
      <ChatBot isOpen={chatOpen} onToggle={() => setChatOpen(!chatOpen)} />
    </div>
  );
};

export default Dashboard;
